        return new Source("{% extends 'base.html.twig' %}

{% block title %}Vehicule index{% endblock %}

{% block body %}
    <h1>Vehicule index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Idv</th>
                <th>Type</th>
                <th>Immat</th>
                <th>Etat</th>
                <th>Kilometrage</th>
                <th>Chevaux</th>
                <th>Marque</th>
                <th>Modele</th>
                <th>Couleur</th>
                <th>Prix</th>
                <th>Img</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for vehicule in vehicules %}
            <tr>
                <td>{{ vehicule.idv }}</td>
                <td>{{ vehicule.type }}</td>
                <td>{{ vehicule.immat }}</td>
                <td>{{ vehicule.etat ? 'Yes' : 'No' }}</td>
                <td>{{ vehicule.kilometrage }}</td>
                <td>{{ vehicule.chevaux }}</td>
                <td>{{ vehicule.marque }}</td>
                <td>{{ vehicule.modele }}</td>
                <td>{{ vehicule.couleur }}</td>
                <td>{{ vehicule.prix }}</td>
                <td><img style=\"width:100px;height:100px\" src=\"{{ vehicule.img }}\"> </td>
                
                <td>
                    <a href=\"{{ path('app_vehicule_show', {'idv': vehicule.idv}) }}\">show</a>
                    <a href=\"{{ path('app_vehicule_edit', {'idv': vehicule.idv}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"12\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_vehicule_new') }}\">Create new</a>
{% endblock %}
